"""# 11. ModelCheckpoint
+ 학습시키는 내내 모니터링하면서 valid의 loss가 증가할 때 정지시킬 수 없는데 <br/>
  이 때 텐서플로우의 유틸(ModelCheckpoint)을 이용해서 해당 부분을 자동으로 찾아낸다.
+ 최고의 Accuracy 혹은 Loss가 나온 Epoch의 W(가중치)를 로컬파일에 임시저장한다. (덮어쓰기)
+ valid - Accuracy / Loss 둘 중 하나를 기준으로 잡을 수 있지만 보통 valid Loss기준으로 저장

### ModelCheckpoint 만들기
"""

# 저장할 파일 경로와 파일명 지정
checkpoint_path = 'my_checkpoint.ckpt' # 확장자: ckpt / h5

# ModelCheckpoint 모델 불러오고 옵션 지정하여 변수에 저장
checkpoint = ModelCheckpoint(filepath=checkpoint_path,
                            save_weights_only = True,
                             save_best_only = True,
                             monitor = 'val_loss',  # 'val_acc' : 정확도 기준
                             verbose = 1) # 로그 출력 할지 말지. T = 1, F = 0

history = model.fit(x_train, y_train, 
                    validation_data = (x_valid, y_valid), 
                    epochs = 20,
                    callbacks=[checkpoint],)

"""### 매우 중요!!"""

