from IPython.display import Image
import numpy as np
import matplotlib.pyplot as plt

"""### relu"""

def relu(x):
    return np.maximum(x, 0)

x = np.linspace(-10, 10)
y = relu(x)

plt.figure(figsize=(10, 7))
plt.plot(x, y)
plt.title('ReLU activation function')
plt.show()

"""**Dense Layer에 ReLU activation 적용**"""

